



UPDATE friendship SET
user_id = FLOOR(1 + RAND()*99.99),
friend_id = FLOOR(1 + RAND()*99.99)
WHERE request_type_id > 0;


UPDATE communities SET
admin_id = FLOOR(1 + RAND()*99.99)
WHERE id > 0;



UPDATE messages SET
from_user_id = FLOOR(1 + RAND()*99.99),
to_user_id = FLOOR(1 + RAND()*99.99)
WHERE id > 0;



UPDATE media SET
user_id = FLOOR(1 + RAND()*99.99)
WHERE id > 0;


UPDATE posts SET
user_id = FLOOR(1 + RAND()*99.99)
WHERE id > 0;


UPDATE posts_media SET
post_id = FLOOR(1 + RAND()*99.99),
media_id = FLOOR(1 + RAND()*99.99)
WHERE id > 0;


UPDATE like_to_user SET
to_user_id = FLOOR(1 + RAND()*99.99)
WHERE from_user_id > 0;


UPDATE like_to_media SET
from_user_id = FLOOR(1 + RAND()*99.99)
WHERE media_id > 0;


UPDATE like_to_post SET
from_user_id = FLOOR(1 + RAND()*99.99)
WHERE post_id > 0;